#!/usr/bin/env python3 

#calculating the AT content in this DNA string and GC content of the string


dna_seq = ''



total_length_dna_seq = len(dna_seq)

a_count = dna_seq.count('A')
c_count = dna_seq.count('C')
g_count = dna_seq.count('G')
t_count = dna_seq.count('T')

a_t_count = (a_count + t_count)

g_c_count = (c_count + g_count)

at_content = (a_t_count / total_length_dna_seq)

gc_content = (g_c_count / total_length_dna_seq)


print ( "AT content is" ,  at_content )
print ( "GC content is" , gc_content )

print ( "awesome sauce!")


